// src/components/common/Card.js
import React from 'react';
import './ItemCard.css'; // Optional: for adding styles

function ButtonGreen({ handle,callfunc,arg}) {
  return (
    <div className="button-green" onClick={callfunc(arg)}>
        <label>{handle}</label>
    </div>
  );
}

export default Card;
